import React from 'react';

const More = () => {
  return (
    <div className='App'>
      <div className='container'>
        <div className='row'></div>
        <div className='col-md-4'>
          <h3>
            {' '}
            > <p>Withdrawl and deposit from Savings or Checking Account</p>
          </h3>
        </div>
      </div>
    </div>
  );
};
export default More;
